function Navbar() {
  return (
    <nav className="navbar">
      <a href="/Stories" className="navbar-link">
        Stories
      </a>
      <a href="/" className="navbar-link">
        Covid Anchor
      </a>
      <a href="/Cases" className="navbar-link">
        Cases
      </a>
      
    </nav>
  );
}
//Nav-Link
function Link(props) {
  return (
    <a href="/Stories" className="navbar-link">
      Stories
    </a>
  );
}

export default Navbar;
